import React from 'react'
import { items } from '../items'

const itemList = items.map(item => (
        <Details item = {item} />
    ))

function Detail({itemList}) {
    
    return ( 
        <div>
            <h1>This is {item.title}</h1>
        </div>
    )
}

export default Detail
